import "./VideoCard.css";
import {Row,Col} from "react-bootstrap"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlayCircle, faCalendarAlt } from "@fortawesome/free-solid-svg-icons";
import {Link} from 'react-router-dom'
import ProductSlide from "./ProudctSlide";
import VideoPage from "../../VideoPage/VideoPage";


function PassVideoShow ({Video}){
	 
    return(
	   	 <>
			<VideoPage vendorVideo={Video} />
			
		{
			console.log("this is from PassVideoShow", Video)
		}
	 </>
	)
	} 

export default function VideoCard(props){

const   Video=props.vendorVideo

 const { title,time,videoTitleHref,url,videoTitle,videoCategories,shop,views,timeAgo,video,iconHref,imgAlt,imgHref,imgSrc}=props.vendorVideo;
 
 

	
	return (
		<>
		{
			console.log("this is from video card", Video.url)
		}
	        
			<div className="video-card">
			 
				<div className="video-card-image">
					<Link className="play-icon" to={iconHref}>
						<FontAwesomeIcon icon={faPlayCircle} />
					</Link>
					<Link to={imgHref}>
						<img className="img-fluid" src={imgSrc} alt={imgAlt} />
					</Link>
				 
				</div>
				<div className="video-card-body">

					<div className="video-title">
						<Link to={videoTitleHref} onClick={()=>PassVideoShow({Video})}>{title}</Link>
					</div>

					<div
						style={{color:'#28a745', fontWeight:'700'}} 
					> 
					<a href={url}>	{  shop}  </a>
						    
					</div>
					<div className="video-view">
						{views} views &nbsp;
						<FontAwesomeIcon icon={faCalendarAlt} /> {timeAgo} ago
					</div>
					<div>
						      
					</div>
					<hr/>
					<div style={{  margin:'5px 0px'}}>
					<Row>
                       <Col>
					  <ProductSlide shop={shop}/>
					   </Col>
					  </Row>
					</div>
				</div>
			</div>
		</>
	);
}

export  {PassVideoShow};
